// App.js
import React from 'react';
import Dashboard from './';
import ImageUploader from './ImageUploader';

function App() {
  return (
    <div style={{ textAlign: 'center', marginTop: '20px' }}>
      <h1>Customizable Dashboard</h1>
      <ImageUploader />
      <Dashboard />
    </div>
  );
}

export default App;
